import { useState } from "react";
import { Menu, X } from "lucide-react";
import "./Navbar.css"; // Ensure the CSS is linked here
import {Globe } from "lucide-react"; // Import the Globe icon

const Navbar = () => {
  const [isOpen, setIsOpen] = useState(false);
  const [activeLink, setActiveLink] = useState("#home");

  const handleClick = (href) => {
    setActiveLink(href);};

  return (
    <nav className="navbar">
      <div className="nav-container">
        <h1 className="logo">Brand</h1>
        <button className="menu-icon" onClick={() => setIsOpen(!isOpen)}>
          {isOpen ? <X /> : <Menu />}
        </button>
        <ul className={`nav-links ${isOpen ? "open" : ""}`}>
          <li><a href="#home" className={activeLink === "#home" ? "active" : ""} 
              onClick={() => handleClick("#home")} >About Us</a></li>
          <li className="dropdown">
            <a href="#solution" className={activeLink === "#solution" ? "active" : ""} 
              onClick={() => handleClick("#solution")} >Solution</a>
            <ul className="dropdown-menu">
              <li><a href="#product1"> Residential Solar PV Installation</a></li>
              <li><a href="#product2">Commercial Solar PV Installation</a></li>
              <li><a href="#product3">Household PV Energy Storage</a></li>
              <li><a href="#product4">Commercial and Industrial PV Energy </a></li>
              <li><a href="#product5">Solar Micro-grid System </a></li>
            </ul>
          </li>
          <li className="dropdown">
            <a href="#product" className={activeLink === "#product" ? "active" : ""} 
              onClick={() => handleClick("#product")}>Product</a>
            <ul className="dropdown-menu">
              <li><a href="#product1"> Energy storage Inverter</a></li>
              <li><a href="#product2">Batery</a></li>
              <li><a href="#product3">PV Module</a></li>
            </ul>
          </li>
          <li><a href="#services" className={activeLink === "#services" ? "active" : ""} 
              onClick={() => handleClick("#services")}>Case</a></li>
          <li><a href="#contact" className={activeLink === "#contact" ? "active" : ""} 
              onClick={() => handleClick("#services")}>Contact</a></li>
          <li><a href="#language"><Globe /> </a></li>
        </ul>
      </div>
    </nav>
  );
};

export default Navbar;
